import React from "react";
import { Link } from "react-router-dom";

export const EmptyPage = (props) => {
  return (
    <>
      <div className="emptyPage">
        <h1>{props.h1}</h1>
        <p>{props.extraInfo}</p>
        <Link to={props.link}>
          <button>{props.btnText}</button>
        </Link>
      </div>
    </>
  );
};
